import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';

class StatsSection extends React.Component {
  render() {
    return (
      <div id="faq" className="justify-content-center paddsection">
        <div className="container">
          <div className="section-title justify-content-center">
            <h11>MAKE YOUR SELECTION</h11>
          </div>
        </div>

        <div className="container">
          <div className="row">
            <div className="col-md-12 d-flex justify-content-center">
              <p1>Select a country, league and fixture, then watch the magic unfold...</p1>
            </div>
          </div>
        </div>

      </div>
    )
  }
}
export default StatsSection;
